import React from 'react';
import { Container, Typography } from '@mui/material';

const TradesList = () => (
  <Container maxWidth="lg" sx={{ mt: 4 }}>
    <Typography variant="h4">My Trades</Typography>
    <Typography variant="body1" sx={{ mt: 2 }}>Trades list coming soon...</Typography>
  </Container>
);

export default TradesList;
